import React, { useState } from 'react';
import './RegistrationPage.css'

export default function RegistrationPage() {

    const [regdatadata, setregdatadata] = useState({
        username: "",
        password: ""
    })

    const { username, password } = regdatadata;

    const changeHandler = e => {
        setregdatadata({ ...regdatadata, [e.target.name]: [e.target.value] });
    }

    const submitHandler = e => {
        e.preventDefault();
        console.log(regdatadata);
        console.log(regdatadata.username);
        console.log(regdatadata.password);

        // const userarray = Users.map(({username}) => username)
        // const passwordarray = Users.map(({password}) => password)
        // for (let i = 0; i < userarray.length; i++) {
        //     console.log(userarray[i], passwordarray[i])
        //     if (regdatadata.username == userarray[i] && regdatadata.password == passwordarray[i] ) {
        //         console.log("found")
        //         // prepare to login

        //     }
        // }
        // show not found and encourage to go to register page

        // rules for validation
        // 
    }

    return (
        <div className='RegForOuter'>
            <form
                className='RegFormContainer'
                method="GET"
                id="RegistrationPage"
                // action to change
                action="formProcessor.html"
                // return validation
                onsubmit="return Validation()"
                target="_blank"
            >
                <div className='RegFormWrapper'>
                    <h1> Registration Page</h1>
                    <div>
                        <p>
                            {" "}
                            username: <br />{" "}
                            <input
                                type="type"
                                onChange={changeHandler}
                                name="accountname"
                                id="accountname"
                                placeholder="abc123"
                                required=""
                            />{" "}
                        </p>
                    </div>
                    <div>
                        <p>
                            {" "}
                            display name (optional) <br />{" "}
                            <input
                                type="type"
                                name="displayname"
                                id="displayname"
                                placeholder="Aston"
                            />{" "}
                        </p>
                    </div>
                    <div>
                        <p>
                            {" "}
                            email address <br />{" "}
                            <input
                                type="email"
                                name="emailaddress"
                                id="emailaddress"
                                placeholder="abc@gmail.com"
                                required=""
                            />{" "}
                        </p>
                    </div>
                    <div>
                        <p>
                            {" "}
                            Phone: <br />{" "}
                            <input
                                type="tel"
                                name="phone"
                                onChange={changeHandler}
                                id="phone"
                                placeholder="123-123-1234"
                                required=""
                            />{" "}
                        </p>
                    </div>
                    <div>
                        {/*todo: 18yo vailidation*/}
                        <label htmlFor="dob">date of birth:</label>
                        <br />
                        <input type="date" id="dob" required="" /> <p />
                    </div>
                    <div>
                        {" "}
                        {/*five digits, five digits + dash + 4 digits*/}
                        <p>
                            {" "}
                            zipcode <br />{" "}
                            <input
                                type="type"
                                name="zipcode"
                                id="zipcode"
                                placeholder={77005}
                                required=""
                            />{" "}
                        </p>
                    </div>
                    <div>
                        {/*todo: password vailidation*/}
                        <p>
                            {" "}
                            password <br />{" "}
                            <input
                                type="password"
                                name="password1"
                                id="password1"
                                placeholder="password"
                                defaultValue=""
                                required=""
                            />{" "}
                        </p>
                    </div>
                    <div>
                        <p>
                            {" "}
                            password confirmation <br />{" "}
                            <input
                                type="password"
                                name="password2"
                                id="password2"
                                defaultValue=""
                                placeholder="confirm password"
                                required=""
                            />{" "}
                        </p>
                    </div>
                    <div>
                        <input type="submit" defaultValue="submit" />
                        <button type="reset">Clear</button>
                    </div>
                    <input
                        type="hidden"
                        name="timestamp"
                        id="timestamp"
                        defaultValue="somevalue"
                    />
                </div>
            </form>
        </div>
    )
}
